var crypto = require('crypto');
var request = require('request');
var merge = require('merge');
var logicCommon = require('./logicCommon.js');

function convertParamLogin(query, ret) {
    var org =
    {
        "id": "0"
        , "token": ""
        , "data": ""
        , "sign": ""
    };

    var cloned = merge(true, org);
    merge(cloned, query);

    for (var i in cloned) {
        //判断参数中是否该有的字段齐全
        if (org[i] == cloned[i] && i != "id" && i != "data") {
            return false;
        }

        //判断参数中是否有为空的字段
        if (0 == (cloned[i] + "").replace(/(^s*)|(s*$)/g, "").length && i != "id" && i != "data") {
            return false;
        }
    }

    ret.AccessToken = cloned.token;

    return true;
}

function createSignLogin(query, key) {
    return crypto.createHash('md5').update(query.AppID + query.AccessToken + key).digest('hex').toLowerCase();
}

function callChannelLogin(attrs, params, query, ret, retf) {
    var cloned = merge(true, params.out_params);
    merge(cloned, query);

    cloned.AppID = attrs.app_id;
    cloned.Sign = createSignLogin(cloned, attrs.secret_key);

    var datacloned = require('querystring').stringify(cloned);
    var options = {
        url: params.out_url,
        method: params.method,
        body: datacloned,
        json: true,
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
            'Content-Length': datacloned.length
        }
    };

    console.log(options);

    //打点：登录验证
    logicCommon.sdkMonitorDot(logicCommon.dotType.LoginDot.RelaySDKVerify);
    request(options, function (error, response, body) {
        if (!error && response.statusCode == 200) {
            //打点：验证成功
            logicCommon.sdkMonitorDot(logicCommon.dotType.LoginDot.ChVerifySuc);
            var retOut = body;
            retOut.Content = ((typeof(retOut.Content) == 'undefined') || (retOut.Content.length == 0)) ? {} : JSON.parse(base64ToString(retOut.Content));
            ret.code = retOut.ResultCode == 1 ? 0 : 1;
            ret.msg = "NORMAL";
            if (ret.code == '0') {
                ret.id = retOut.Content.UID;
            } else {
                ret.id = '';
            }

            ret.nick = "";
            ret.token = cloned.AccessToken;
            ret.value = retOut;
        } else {
            //打点：验证失败
            logicCommon.sdkMonitorDot(logicCommon.dotType.LoginDot.ChVerifyErr);
            ret.code = 2;
            ret.msg = "OUT URL ERROR";
            ret.value = "";
        }

        retf(ret);
    });
}
function base64ToString(txt) {
    var s = new Buffer(txt, 'base64')
    return s.toString();
}
function compareOrder(attrs, gattrs, params, query, ret, game, channel, retf) {
    var Content = ((typeof(query.Content) == 'undefined') || (query.Content.length == 0)) ? {} : JSON.parse(base64ToString(query.Content));

    var retValue = {};
    retValue.code = Content.OrderStatus == 1 ? 0 : 1;
    retValue.id = Content.UID;
    retValue.order = query.OrderSerial;
    retValue.cporder = query.CooperatorOrderSerial;
    retValue.info = Content.ExtInfo?Content.ExtInfo:'';

    var retBaidu = {};
    var SecretKey = attrs.secret_key;
    retBaidu.AppID = attrs.app_id;

    retBaidu.ResultCode = 0;
    retBaidu.ResultMsg = "FAILURE";
    retBaidu.Content = "";
    retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

    console.log(Content);

    if (retValue.code != '0') {
        retf(JSON.stringify(retBaidu));
        return;
    }
    logicCommon.getNotifyUrl(retValue.cporder, params, function (hasData) {
        if (!hasData) {
            retf(JSON.stringify(retBaidu));
            return;
        } else {
            retValue.sign = logicCommon.createSignPay(retValue, gattrs.gkey);
            logicCommon.UpdateOrderStatus(game, channel, retValue.cporder, retValue.order, 1, 0,query);
            var options = {
                url: params.verifyurl,
                method: "POST",
                body: retValue,
                json: true
            };

            request(options, function (error, response, body) {
                console.log('requesterror>>>>'+JSON.stringify(error));
                console.log('requestbody>>>>'+JSON.stringify(body));
                console.log('requestresponse>>>>'+response.statusCode);
                if (!error && response.statusCode == 200) {
                    var retOut = body;
                    if (typeof retOut.code == 'undefined') {
                        retf('FAILURE');
                        return;
                    }
                    if (retOut.code == '0') {
                        if(retOut.Itemid){
                            logicCommon.mapItemLists(attrs,retOut);
                        }

                        if (Content.UID == retOut.id//OrderMoney
                            && Content.OrderMoney * 100 >= retOut.amount * 0.9
                            && Content.OrderMoney * 100 <= retOut.amount) {
                            if (retOut.status == '2') {
                                retf(JSON.stringify(retBaidu));
                                return;
                            } else if (retOut.status == '4' || retOut.status == '3') {

                                logicCommon.UpdateOrderStatus(game, channel, retValue.cporder, retValue.order, 4,Content.OrderMoney * 100);
                                retBaidu.ResultCode = 1;
                                retBaidu.ResultMsg = "SUCCESS";
                                retBaidu.Content = "";
                                retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

                                retf(JSON.stringify(retBaidu));
                                return;
                            } else {

                                logicCommon.UpdateOrderStatus(game, channel, retValue.cporder, retValue.order, 2,0);
                                var data = {};
                                data.code = '0000';
                                data.msg = 'NORMAL';
                                console.log(data);
                                retf(data);
                                return;
                            }
                        } else {

                            logicCommon.UpdateOrderStatus(game, channel, retValue.cporder, retValue.order, 3,0);

                            retf(JSON.stringify(retBaidu));
                            return;
                        }
                    } else {

                        retf(JSON.stringify(retBaidu));
                        return;
                    }
                } else {

                    retf(JSON.stringify(retBaidu));
                    return;
                }
            });

        }
    });

}
function callGamePay(attrs, gattrs, params, query, ret, retf, game, channel, channelId) {
    console.log('callGamePay');
    var Content = ((typeof(query.Content) == 'undefined') || (query.Content.length == 0)) ? {} : JSON.parse(base64ToString(query.Content));

    var retValue = {};
    retValue.code = Content.OrderStatus == 1 ? 0 : 1;
    retValue.id = Content.UID;
    retValue.order = query.OrderSerial;
    retValue.cporder = query.CooperatorOrderSerial;
    retValue.OrderType = 1;
    retValue.info = Content.ExtInfo?Content.ExtInfo:'';
    console.log(Content);
    if (retValue.code != '0') {
        //打点：其他支付失败
        logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.Error);
        var SecretKey = attrs.ProductSecret;
        var retBaidu = {};
        retBaidu.AppID = attrs.app_id;
        retBaidu.ResultCode = 0;
        retBaidu.ResultMsg = "FAILURE";
        retBaidu.Content = "";
        retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

        retf(JSON.stringify(retBaidu));
        return;
    }

    logicCommon.getNotifyUrl(retValue.cporder, params, function (hasData) {
        if (!hasData) {
            //打点：其他支付失败
            logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.Error);

            var SecretKey = attrs.ProductSecret;
            var retBaidu = {};
            retBaidu.AppID = attrs.app_id;
            retBaidu.ResultCode = 0;
            retBaidu.ResultMsg = "FAILURE";
            retBaidu.Content = "";
            retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

            retf(retBaidu);
        } else {
            retValue.sign = logicCommon.createSignPay(retValue, gattrs.gkey);
            retValue.appid = attrs.app_id;
            retValue.gamename = game;
            retValue.sdkname = channel;
            retValue.channel_id = channelId;
            retValue.amount = '' + Content.OrderMoney * 100 + '';

            var options = {
                url: params.out_url,
                method: params.method,
                body: retValue,
                json: true
            };
            console.log(options);

            //打点：支付回调通知
            logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.PayNotice);
            request(options, function (error, response, body) {
                if (!error && response.statusCode == 200) {
                    var retOut = body;
                    console.log(retOut);
                    //日志记录CP端返回
                    if (typeof retOut.code == 'undefined') {
                        //打点：其他支付失败
                        logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.Error);
                        var SecretKey = attrs.ProductSecret;
                        var retBaidu = {};
                        retBaidu.AppID = attrs.app_id;
                        retBaidu.ResultCode = 0;
                        retBaidu.ResultMsg = "FAILURE";
                        retBaidu.Content = "";
                        retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

                        retf(retBaidu);
                    }

                    if (retOut.code == 0) {
                        //打点：服务器正确处理支付成功回调
                        logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.PaySuc);
                        logicCommon.UpdateOrderStatus(game, channel, retValue.cporder, retValue.order, 4,Content.OrderMoney * 100);
                        var SecretKey = attrs.secret_key;
                        var retBaidu = {};
                        retBaidu.AppID = attrs.app_id;
                        retBaidu.ResultCode = 1;
                        retBaidu.ResultMsg = "SUCCESS";
                        retBaidu.Content = "";
                        retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

                        retf(JSON.stringify(retBaidu));
                    }
                    else {
                        //打点：其他支付失败
                        logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.Error);
                        var SecretKey = attrs.ProductSecret;
                        var retBaidu = {};
                        retBaidu.AppID = attrs.app_id;
                        retBaidu.ResultCode = 0;
                        retBaidu.ResultMsg = "FAILURE";
                        retBaidu.Content = "";
                        retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

                        retf(JSON.stringify(retBaidu));
                    }

                } else {
                    //打点：其他支付失败
                    logicCommon.sdkMonitorDot(logicCommon.dotType.PayDot.Error);
                    var SecretKey = attrs.ProductSecret;
                    var retBaidu = {};
                    retBaidu.AppID = attrs.app_id;
                    retBaidu.ResultCode = 0;
                    retBaidu.ResultMsg = "FAILURE";
                    retBaidu.Content = "";
                    retBaidu.Sign = crypto.createHash('md5').update('' + retBaidu.AppID + retBaidu.ResultCode + SecretKey).digest('hex');

                    retf(JSON.stringify(retBaidu));
                }
            });
        }
    });
}

function checkSignPay(attrs, query) {
    var osign = crypto.createHash('md5').update(
        attrs.app_id +
        query.OrderSerial +
        query.CooperatorOrderSerial +
        query.Content +
        attrs.secret_key
    ).digest('hex');

    console.log(query.Sign + " :: " + osign);

    if (query.Sign != osign) {
        return false;
    }

    return true;
}

function createSignCheckOrder(query, key) {
    return crypto.createHash('md5').update(query.AppID + query.CooperatorOrderSerial + key).digest('hex').toLowerCase();
}

function checkOrder(attrs, params, query, ret, retf) {
    var cloned = {
        "AppID": 0
        , "CooperatorOrderSerial": ""
        , "OrderType": 1
        , "Sign": ""
        , "Action": 10002
    };

    cloned.AppID = attrs.app_id;
    cloned.CooperatorOrderSerial = query.cporder;
    cloned.Sign = createSignCheckOrder(cloned, attrs.secret_key);
    cloned.Sign = createSignCheckOrder(cloned, attrs.ProductSecret);
    var datacloned = require('querystring').stringify(cloned);
    var options = {
        url: "http://querysdkapi.91.com/CpOrderQuery.ashx",
        method: 'POST',
        body: datacloned,
        json: true,
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
            'Content-Length': datacloned.length
        }
    };

    console.log(options);

    request(options, function (error, response, body) {
        if (!error && response.statusCode == 200) {
            var retOut = body;
            if (retOut.ResultCode == 1
            ) {
                //Content参数需要UrlDecode后再进行Base64解码
                var base64Item = base64ToString(UrlDecode(retOut.Content));
                //解析json数据
                retOut.Content = JSON.parse(base64Item);
            }
            ret.code = retOut.ResultCode == 1 ? 0 : 1;
            ret.msg = "NORMAL";
            ret.id = retOut.Content.Uid || "";
            ret.nick = "";
            ret.token = "";
            ret.value = retOut;
        } else {
            ret.code = 2;
            ret.msg = "OUT URL ERROR";
            ret.value = "";
        }

        retf(ret);
    });

    return true;
}

function UrlDecode(str) {
    var ret = "";
    for (var i = 0; i < str.length; i++) {
        var chr = str.charAt(i);
        if (chr == "+") {
            ret += " ";
        } else if (chr == "%") {
            var asc = str.substring(i + 1, i + 3);
            if (parseInt("0x" + asc) > 0x7f) {
                ret += asc2str(parseInt("0x" + asc + str.substring(i + 4, i + 6)));
                i += 5;
            } else {
                ret += asc2str(parseInt("0x" + asc));
                i += 2;
            }
        } else {
            ret += chr;
        }
    }
    return ret;
}

function asc2str(code) {
    var n = AnsiToUnicode(code);
    return String.fromCharCode(n);
}

function AnsiToUnicode(chrCode) {
    var chrHex = chrCode.toString(16);
    chrHex = "000" + chrHex.toUpperCase();
    chrHex = chrHex.substr(chrHex.length - 4);
    var i = AnsicodeChr().indexOf(chrHex);
    if (i != -1) {
        chrHex = UnicodeChr().substr(i, 4);
    }
    return parseInt(chrHex, 16)
}

